    function getExif(img) {
        //alert("Inside getExif");
        window.resolveLocalFileSystemURL(img, extractEXIF, onFail);
    };

    /**extractEXIF: extracts metadata from images */
    function extractEXIF(path) {
        //alert('extractExif');
        path.file(function (file) {
            //alert('path');
            EXIF.getData(file, function () {
                //alert('getData');
                //window.location = "input-page.html";
                var getAllMetaData = EXIF.getAllTags(this);
                //var metaDataSpan = document.getElementById("allMetaDataSpan");
                var metaDataSpan = '';
                var convertToString = JSON.stringify(getAllMetaData, null, "\t");
                var objVal = JSON.parse(convertToString);
                var dateTime = objVal.DateTime;

                //metaDataSpan.innerHTML = JSON.stringify(
                metaDataSpan = JSON.stringify(
                    "Timestamp: " + objVal.DateTime +
                    ", Latitude: " + objVal.GPSLatitude +
                    ", Longitude: " + objVal.GPSLongitude);
                //writeNewPost(objVal.DateTime, objVal.GPSLatitude, objVal.GPSLongitude);

                console.log(metaDataSpan);
                $("#metadata-text").val(metaDataSpan);
            });
        });
    }

